@-moz-document url-prefix("https://e-shuushuu.net/") {
/*
E-shuushuu Customizable CSS
rev20191011-2338*/
html
{
background: /*[[bg-opacity]]*/ /*[[bgc]]*/ url('/*[[bg]]*/') !important;
/*[[bgr]]*/
background-attachment: fixed!important;
background-position: center!important;
}


/*[[tranf]]*/ /*[[shuu-bnr]]*/ /*[[app]]*/ /*[[effect]]*/

#banner a
{
position:absolute;
/*[[banner-img]]*/
}


#banner:after {
content : "";
display: block;
position: absolute;
top: 0;
left: 0;
background: url('/*[[bnr-img]]*/')!important;
background-repeat:no-repeat;
background-size:cover;
background-attachment: fixed;
background-position: center;
width: 100%;
height: 100%;
opacity : /*[[bn-opacity]]*/ ;
z-index: 0;
}
}

